import React from "react";
import SignIn from "./Screens/SignIn";
import Agenda from "./Screens/Agenda";
import Alert from "./Screens/Alert";
import SignUp from "./Screens/SignUp";
import CancelReservation from "./Screens/CancelReservation";
import Date from "./Screens/Date";
import ReservationStatus from "./Screens/ReservationStatus";
import Main from "./Screens/Main";
import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

const App = () => {
  return (
    <Router>
      <Switch>
        <div className="App">
          <Route path="/alert">
            <Alert />
          </Route>
          <Route path="/agenda">
            <Agenda />
          </Route>
          <Route path="/cancel">
            <CancelReservation />
          </Route>
          <Route path="/signin">
            <SignIn />
          </Route>
          <Route path="/signup">
            <SignUp />
          </Route>
          <Route path="/check">
            <ReservationStatus />
          </Route>
          <Route path="/date">
            <Date />
          </Route>
          <Route path="/" exact>
            <Main />
          </Route>
        </div>
      </Switch>
    </Router>
  );
};

export default App;
